<h1>Â¿CÃ³mo esperar por un elemento?</h1>
<p> Muchas veces, cuando automatizamos pruebas dependemos de la velocidad de respuesta de la pÃ¡gina web que estamos probando. A veces, esta web va mÃ¡s lenta de lo que esperamos y eso hace que nuestras pruebas fallen, ya que intentan interactuar con un elemento que todavÃ­a no estÃ¡ disponible o visible. Esta situaciÃ³n se da muy a menudo en proyectos de automatizaciÃ³n y es por ello que Selenium nos provee de herramientas para solucionarlo. </p>
<p>Lo primero que podemos hacer es implementar una<span class=bold> espera implÃ­cita</span>, es decir, esperar por un tiempo determinado hasta que el elemento en cuestiÃ³n estÃ© presente y disponible. Esto, si bien puede solucionar nuestro problema, no es una buena prÃ¡ctica porque: </p>
<style class=sf-hidden>.lesson__markdown__body ul li::before{margin-left:20px;color:#9259B9}</style>
 <ul>
<li>Nos hace esperar por un tiempo fijo, independientemente si el objeto aparece o no. </li>
<li>La espera fija no nos asegura que el objeto aparezca. </li>
 </ul>
 <p>Para mejorar esto, lo que Selenium nos provee son <span class=bold>esperas explÃ­citas</span> en donde podemos esperar por un elemento en un rango de tiempo de N segundos tal como se define en la clase Â«WebDriverWaitÂ» o hasta que se cumplan las condiciones de espera. Selenium provee las siguientes condiciones de espera: </p>
 <ul>
 <li>alertIsPresent()</li>
 <li>elementSelectionStateToBe()</li>
 <li>elementToBeClickable()</li>
 <li>elementToBeSelected()</li>
 <li>frameToBeAvaliableAndSwitchToIt()</li>
 <li> invisibilityOfTheElementLocated()</li>
 <li>invisibilityOfElementWithText()</li>
 <li>presenceOfAllElementsLocatedBy()</li>
 <li>presenceOfElementLocated()</li>
 <li> textToBePresentInElement()</li>
 <li>textToBePresentInElementLocated()</li>
 <li>textToBePresentInElementValue()</li>
 <li> titleIs()</li>
 <li>titleContains()</li>
 <li>visibilityOf()</li>
 <li>visibilityOfAllElements()</li>
 <li> visibilityOfAllElementsLocatedBy()</li>
 <li> visibilityOfElementLocated()</li>
 </ul>
 <p>De esta forma, solucionamos el uso de sleep() que se venÃ­a usando hasta el momento. </p>
